import { useState } from "react";
import "./Book.css";
import {
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
} from '@mui/material';

function Book({ id, Name, Author, Publisher, Image, Availability, Ledger, deleteBook, editBook }) {
  const [open, setOpen] = useState(false);
  const [updatedBook, setUpdatedBook] = useState({
    name: Name,
    author: Author,
    publisher: Publisher,
    availability: Availability,
    ledger: Ledger,
  });

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setUpdatedBook((prevBook) => ({
      ...prevBook,
      [name]: value,
    }));
  };

  const handleUpdate = () => {
    editBook(id, updatedBook);
    setOpen(false);
  };

  return (
    <>
      <div className="box">
        <div className="Pic">
          <img src={Image} alt="A book" />
        </div>
        <div className="book">{Name}</div>
        <div className="Author">Author: {Author}</div>
        <div className="Publisher">Publication: {Publisher}</div>
        <div className="Availability">Availability: {Availability}</div>
        <div className="Ledger">Ledger: {Ledger}</div>
        <button className="delete" onClick={() => deleteBook(id)}>
          Delete
        </button>
        <button className="update" onClick={handleClickOpen}>
          Update
        </button>
        <Dialog open={open} onClose={handleClose} fullWidth>
          <DialogTitle>Update Book</DialogTitle>
          <DialogContent>
            <TextField
              name="name"
              label="Update Book Name"
              value={updatedBook.name}
              onChange={handleInputChange}
              variant="outlined"
              fullWidth
            />
            <TextField
              name="author"
              label="Update Author Name"
              value={updatedBook.author}
              onChange={handleInputChange}
              variant="outlined"
              fullWidth
            />
            <TextField
              name="publisher"
              label="Update Publisher Name"
              value={updatedBook.publisher}
              onChange={handleInputChange}
              variant="outlined"
              fullWidth
            />
            <TextField
              name="availability"
              label="Update Availability"
              value={updatedBook.availability}
              onChange={handleInputChange}
              variant="outlined"
              fullWidth
            />
            <TextField
              name="ledger"
              label="Update Ledger"
              value={updatedBook.ledger}
              onChange={handleInputChange}
              variant="outlined"
              fullWidth
            />
          </DialogContent>
          <DialogActions>
            <Button onClick={handleUpdate} variant="contained" color="primary">
              Update
            </Button>
            <Button onClick={handleClose} variant="contained" color="error">
              Close
            </Button>
          </DialogActions>
        </Dialog>
      </div>
    </>
  );
}

export default Book;
